import React from 'react'
import {Route, Link } from 'react-router-dom'
import GestionClientes from './ShowClientes';  // Importa tu componente GestionClientes

const AdminHome = () => {
    return (
        <div>
            <h2>Bienvenido, Administrador</h2>
            {/* Links a las rutas específicas del administrador */}
            <Link to="/admin-home/gestion-clientes" className='btn btn-info'>
                <i className='fas fa-edit' /> Gestionar clientes
            </Link>
            <Link to="/admin-home/gestion-cocteles" className='btn btn-info'>
                <i className='fas fa-edit' /> Gestionar cocteles
            </Link>

            {/* Rutas específicas del administrador */}
            <Route path="/admin-home/gestion-clientes" component={GestionClientes} />
            {/*             <Route path="/admin-home/gestion-cocteles" component={GestionCocteles} />
 */}
        </div>
    )
}

export default AdminHome
